import React from 'react';
import './index.css'
import { useSelector } from 'react-redux';


function Header(props) {

    const {currenUser} = useSelector(state=>state.userReducer);

    return (
        <div className="header">
            <div className="logo">
                <h3>Topilmalar</h3>
            </div>
            <div className="navbar">
                <div className="sport">
                    <p><strong>Reyestr</strong></p>
                </div>
                <div className="lessons">
                    <p><strong>Statistika</strong></p>
                </div>
                <div className='themes'>
                    <p><strong>Tizim haqida</strong></p>
                </div>
                <div className='themes'>
                    <p><strong>Yordam</strong></p>
                </div>
            </div>
            <div className="actions">
                <button className='btn btn-outline-info m-2'>Ariza berish</button>
                {currenUser?.id ? <button className='btn btn-danger '>Chiqish</button> : <button className='btn btn-info '>Kirish</button>}
            </div>
        </div>
    );
}

export default Header;
